import React from 'react';
import {PlayersInfo} from './PlayersInfo';

const App = () => {
	return(
		<div>
			<h1>Name: {PlayersInfo[0].name} Age: {PlayersInfo[0].age}</h1>
		</div>
	)
}

export default App;
